export const Pie = Template.bind({});

Pie.args = {
  diameter: "300px",
  chartData: [
    { label: "BTC", value: 12244 },
    { label: "ETH", value: 53345 },
    { label: "USDC", value: 44313 },
  ],
  chartColors: [colors.blue.color, colors.blue.midtone, colors.blue.background],
};


